// src/components/PlayerProfile.tsx
import React, { useState } from 'react';
import {
  Box,
  Input,
  Button,
  Heading,
  Stack,
  Text,
  Select,
} from '@chakra-ui/react';

const PlayerProfile: React.FC = () => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [age, setAge] = useState('');
  const [role, setRole] = useState<'Batter' | 'Bowler' | 'All-Rounder'>('Batter');
  const [team, setTeam] = useState('');
  const [phone, setPhone] = useState('');
  const [profilePic, setProfilePic] = useState('');
  const [battingStats, setBattingStats] = useState({ runs: 0, matchesPlayed: 0 });
  const [bowlingStats, setBowlingStats] = useState({ wickets: 0, matchesPlayed: 0 });

  const handleSubmit = (e: React.FormEvent) => {
    e.preventDefault();
    // Perform update logic (e.g., send data to server)
    alert('Profile updated successfully!');
    console.log({
      name,
      email,
      age,
      role,
      team,
      phone,
      profilePic,
      battingStats,
      bowlingStats,
    });
  };

  return (
    <Box
      bg="white"
      p={6}
      borderRadius="md"
      boxShadow="lg"
      maxWidth="500px"
      mx="auto"
    >
      <Heading as="h2" size="lg" mb={4} textAlign="center" color="#2a2e43">
        Edit Profile
      </Heading>
      <form onSubmit={handleSubmit}>
        <Stack spacing={4}>
          <Text>Name</Text>
          <Input
            type="text"
            value={name}
            onChange={(e) => setName(e.target.value)}
            placeholder="Enter your name"
            required
          />
          <Text>Email</Text>
          <Input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            placeholder="Enter your email"
            required
          />
          <Text>Age</Text>
          <Input
            type="number"
            value={age}
            onChange={(e) => setAge(e.target.value)}
            placeholder="Enter your age"
            required
          />
          <Text>Role</Text>
          <Select
            value={role}
            onChange={(e) => setRole(e.target.value as 'Batter' | 'Bowler' | 'All-Rounder')}
          >
            <option value="Batter">Batter</option>
            <option value="Bowler">Bowler</option>
            <option value="All-Rounder">All-Rounder</option>
          </Select>
          <Text>Team</Text>
          <Input
            type="text"
            value={team}
            onChange={(e) => setTeam(e.target.value)}
            placeholder="Enter your team name"
          />
          <Text>Phone Number</Text>
          <Input
            type="tel"
            value={phone}
            onChange={(e) => setPhone(e.target.value)}
            placeholder="Enter your phone number"
          />
          <Text>Profile Picture URL</Text>
          <Input
            type="url"
            value={profilePic}
            onChange={(e) => setProfilePic(e.target.value)}
            placeholder="Enter profile picture URL"
          />
          <Text>Batting Stats</Text>
          <Text>Runs: {battingStats.runs} | Matches Played: {battingStats.matchesPlayed}</Text>
          <Text>Bowling Stats</Text>
          <Text>Wickets: {bowlingStats.wickets} | Matches Played: {bowlingStats.matchesPlayed}</Text>
          <Button
            type="submit"
            colorScheme="yellow"
            variant="solid"
            width="full"
          >
            Save Changes
          </Button>
        </Stack>
      </form>
    </Box>
  );
};

export default PlayerProfile;
